import { AppBar, Box, Button, Toolbar, Typography } from "@mui/material";
import React from "react";

const Home = () => {
	return (
		<Box sx={{ flexGrow: 1 }}>
			<AppBar
				position="static"
				sx={{
					display: "flex",
					flexDirection: "row",
				}}
			>
				<Toolbar
					sx={{
						color: "blue",
						flexGrow: 1,
						display: "flex",
						flexDirection: "row",
						alignItems: "center",
						justifyContent: "space-between",
					}}
				>
					<Typography variant="h6" sx={{ marginLeft: "40%" }}>
						Dog Gallery
					</Typography>
					<Button
						sx={{
							color: "white",
							backgroundColor: "blue",
						}}
						variant="contained"
					>
						Custom Search
					</Button>
				</Toolbar>
			</AppBar>
		</Box>
	);
};

export default Home;
